import React from 'react';
import classes from './Newsroom.module.css';

function Newsroom() {
  return (
    <section className={classes.newsroom}>
      <h2>Newsroom</h2>
      <p>ArcelorMittal Nippon Steel India renews partnership with Protean to advance 'Beti Padhao' scholarship initiative.</p>
      <p>ArcelorMittal Nippon Steel India appoints Dr. Arvind Bodhankar as Chief Sustainability Officer.</p>
    </section>
  );
}

export default Newsroom;
